import React from "react";
import { Link, useNavigate } from "react-router-dom";

const AdminNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("adminToken");
    localStorage.removeItem("adminData"); // also clear admin data
    navigate("/admin/login");
  };

  return (
    <nav className="bg-blue-700 text-white p-4 flex justify-between items-center">
      <h1 className="text-lg font-bold">Admin Panel</h1>
      <div className="flex items-center space-x-4">
        <Link to="/admin/dashboard" className="hover:underline">
          Dashboard
        </Link>
        <Link to="/admin/courses" className="hover:underline">
          Courses
        </Link>
        <Link to="/admin/add-course" className="hover:underline">
          Add Course
        </Link>
        <Link to="/admin/add-lecture" className="hover:underline">
          Add Lecture
        </Link>
        <Link to="/admin/instructors" className="hover:underline">
          Instructors
        </Link>
        <button
          onClick={handleLogout}
          className="bg-red-600 px-2 py-1 rounded hover:bg-red-700"
        >
          Logout
        </button>
      </div>
    </nav>
  );
};

export default AdminNavbar;
